import React from "react";
import Navbar from "./Navbar";
import { BsCart2,BsFillPersonFill } from "react-icons/bs";

function Header(props) {

    return (
        <header>
            <div className={'container'}>
                <div className="">
                    <input type={'search'} className={'form-control form-control-sm mx-2'}/>
                    <button type={'submit'} className={'btn'}>검색</button>
                    <div className={'d-flex justify-content-end'}>
                        <button type={'button'} className={'btn '}><BsCart2 /></button>
                        <button type={'button'} className={'btn justify-content-end'}><BsFillPersonFill /></button>
                    </div>
                </div>
            </div>

            <Navbar />
        </header>
    )
}

export default Header;
